import { BrowserRouter as Routers,Route,Router,Link } from "react-router-dom";
import Home from"./home";
import Page from"./page";
import About from"./about";


import  "./RoutersEx.css";
function RoutersEx(){
    return(
        <div>
            <Router>
            <ul>
                <li><Link to="/home">Home</Link></li>
                <li>About</li>
                <li>Contact</li>
                <li>Service</li>
            </ul>
            <Routes>
                <Route path="/home" element={<Home/>}/>
            </Routes>
            </Router>
        </div>
    )
}
export default RoutersEx;
